import React from 'react';
import Home from './Components/Home';
import SectionDivider from './Components/SectionDivider';
import LatestCollection from './Components/LatestCollection';
import './App.css';

import './SASS/main.scss';

function App() {
  return (
    <div>
      <Home />
      <SectionDivider />
      <LatestCollection />
    </div>
  );
}

export default App;
